package rapidcaptcha_server

import (
	"fmt"
	"github.com/gorilla/websocket"
	"net/http"
	"testing"
	"time"
)

type Captcha struct {
	GroupID   string `json:"groupId"`
	Image     string `json:"image"`
	IsRequest bool   `json:"isRequest"`
}

func TestSend(t *testing.T) {
	d := websocket.Dialer{}
	h := http.Header{}
	h.Add("Content-Type", "application/json")
	c, _, err := d.Dial("ws://localhost:8080/ws", h)
	if err != nil {
		t.Error(err)
	}

	captcha := Captcha{GroupID: "captcha2@captcha.com", IsRequest: true, Image: `data:image/png;base64,`}
	err = c.WriteJSON(captcha)
	if err != nil {
		t.Error(err)
	}

	for {
		messageType, p, err := c.ReadMessage()
		if err != nil {
			t.Error(err)
		}
		fmt.Println(messageType, string(p))
	}
}

func TestSendChange(t *testing.T) {
	d := websocket.Dialer{}
	h := http.Header{}
	h.Add("Content-Type", "application/json")
	c, _, err := d.Dial("ws://localhost:8080/ws", h)
	if err != nil {
		t.Error(err)
	}

	captcha := Captcha{GroupID: "captcha@captcha.com", IsRequest: true, Image: `data:image/png;base64,`}
	err = c.WriteJSON(captcha)
	if err != nil {
		t.Error(err)
	}
	time.Sleep(time.Second * 5)
	captcha = Captcha{GroupID: "captcha2@captcha.com", IsRequest: true, Image: `data:image/png;base64,`}
	err = c.WriteJSON(captcha)
	if err != nil {
		t.Error(err)
	}
}
